const styles = theme => ({
    button: {
        margin: theme.spacing.unit,
        padding: theme.spacing.unit * 2
    },
    backBtn: {
        textAlign: 'right',
        '& svg': {
          fontSize: 30,
          background: '#fff',
          border: '1px solid #03A9F4',
          color: '#03A9F4',
          borderRadius: 3,
          cursor: 'pointer'
        }
      }

});
export default styles;
